import "./App.css";
import { useState } from "react"

function App() {
  const [listOfUsers, setListOfUsers] = useState([
    {id: 1, name: "A", age: 20, username: "gorf"},
  ])
  return (
    <div className="App">
      <div>
        {listOfUsers.map((user) => {
          return(
            <div>
              <h1>Name: {user.name}</h1>
              <h1>Age: {user.age}</h1>
              <h1>Username: {user.username}</h1>
            </div>  
          );
        })}
      </div>
    </div>
  );
}

export default App;
